import React from "react";
import styles from "../../style/products/subnav.module.css";
import { Link } from "react-router-dom";

function SubNav() {
  return (
    <div className={styles.subNavContainer}>
      <ul>
        <li>
          <Link to="/products">All</Link>
        </li>
        <li>
          <Link to="/products/hoodies">MARVEL TOY'S</Link>
        </li>
        <li>
          <Link to="/products/tshirts">Expensive Toy's</Link>
        </li>
        <li>
          <Link to="/products/sweatshirts">Sweat-Shirts</Link>
        </li>
        <li>
          <Link>Jeans</Link>
        </li>
      </ul>
    </div>
  );
}

export default SubNav;
